INSERT INTO `pages` (`id`, `title`, `section`, `device_type`, `content`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(4,	'Privacy Policy',	'Privacy Policy',	'web',	'<p>A Privacy Policy is a document where you disclose what personal data you collect from your website&#39;s visitors, how you collect it, how you use it and other important details about your privacy practices.</p>\r\n\r\n<p>In this post, we&#39;ll take a look at what Privacy Policies are and why you likely need to have one posted on your website. We&#39;ll also go over some important clauses that are useful to include in your Privacy Policy. Finally, we&#39;ll look at how different websites display their Privacy Policies.</p>\r\n\r\n<p>Privacy Policies are legally binding agreements you are required to post on your website if you&#39;re collecting any sort of personal information from your site&#39;s visitors or customers.</p>\r\n\r\n<p>A Privacy Policy is an important legal document that lets users understand the various ways a website might be collecting personal information. The purpose of a Privacy Policy is to inform users of your data collection practices in order to protect the customer&#39;s privacy.</p>\r\n\r\n<p>Your Privacy Policy should disclose how the website/app collects information, how the information is used, whether or not it is shared with third parties and how it is protected and stored.</p>',	1,	NULL,	'2022-05-31 00:20:27',	'2022-07-08 07:25:37'),
(5,	'Term and Conditions',	'Term and Conditions',	'web',	'<p><strong>What should I do if I run an e-commerce website? Is it recommended to create a Terms and Conditions document?<br />\r\nYes, it is not only advisable but also often mandatory.</strong></p>\r\n\r\n<p>Not only are terms critically important for protecting you from potential liabilities, but they regularly contain legally mandated information such as users&rsquo; rights, withdrawal or cancellation disclosures.</p>\r\n\r\n<p>Generally, a website / app should have an accurate and valid Terms of Service document in place whenever complex issues are at stake, such as in the case of e-commerce, where sensitive information such as payment data is processed.</p>\r\n\r\n<p>In e-commerce sites, the Terms of Service is typically the document that contains information related to conditions of sale and disclosures on methods of payment, shipping, delivery, withdrawals, and cancellation conditions etc. &ndash; as commonly required by consumer protection regulations. European providers of B2C services (selling goods / services) are also required to include, among other things, an Online Dispute Resolution (ODR) statement that explains the mandatory dispute resolution process online.</p>\r\n\r\n<p>Despite how simple they appear, terms and conditions are meant to meet incredibly complex and highly specific scenarios. Because each terms and conditions document is a legally binding contract that is meant to protect you, the business owner, it&rsquo;s imperative that the document matches your specific business processes, model, and remains up-to-date with the various laws referenced in its contents. Templates simply cannot do this, therefore, we strongly suggest that you avoid using templates.</p>\r\n\r\n<p>In general, there is no legal difference. Terms and conditions, terms of service and terms of use are names all used to refer to the same document. The particular name used at any point in time is simply a matter of preference.</p>',	1,	NULL,	'2022-05-31 00:43:00',	'2022-05-31 00:51:40');
